import { Link } from 'react-router-dom'
import styled from 'styled-components'

const TopLeft = styled.div`
  position: absolute;
  top: 30vw;
  left: 6vw;
  font-family: 'Playfair Display', sans-serif;
  font-weight: 700;
  font-size: min(3vw, 5em);
  line-height: 0.9em;
  height: 60px;
  width: 60px;
  background-image: url("/kshack-logo.jpg");
`

export const ARTISTS = [
  { id: 0, name: "ronnie-makebelieve", song: "sleep.wav", description: "chill ronnies" },
  { id: 1, name: "sleep-300", song: "sleep.wav", description: "chill dudes" },
];

export function Artists() {
  return (
    <TopLeft>
        {ARTISTS.map((artist, index) => {
            return <Artist artist={artist} index={index} />
        })}
    </TopLeft>
  )
}

function Artist({artist, index}) {
    return (
        <div className='artist-wrapper' key={index}>
            {artist.name}
            <Link to={{ pathname: `/artists/${artist.name}`}}>{artist.name}</Link>
        </div>
    )
}
